import React from "react";
import { Card,Image } from "react-bootstrap";
import UserProfil from "../wiki/UserProfil";
const UserPage = () => {
    const userProfil = new UserProfil();
    return (
        <Card
            style={{borderRadius: 20, margin: '0px 10px 0px 10px', borderWidth: '5px'}}
        >
            <div className="flex">
                <Image
                    style={{margin: 20}}
                    src = {userProfil.user.img()}
                    width={300}
                    height={300}
                    roundedCircle
                ></Image>
                Филатьев Владислав
            </div>

            <div style={{fontSize: 30, marginLeft: 30}}>
                О себе:
            </div>

        </Card>
    );
};

export default UserPage;
